lyrics:
Well, where oh where can my baby be?
The lord took her away from me
She's gone to heaven so I got to be good;
so I can see my baby when I leave this world
We were out on a date in my daddy s car;
we hadn't driven very far
There in the road straight ahead;
the car was stalled, the engine was dead
I couldn't stop so I swerved to the right;
never forget, the sound that night
The crying tires, the busting glass;
her painful scream that I heard last
Well, where oh where can my baby be?
The lord took her away from me
She's gone to heaven so I got to be good;
so I can see my baby when I leave this world
Well, when I woke up the rain was pouring down;
there were people, standing all around
Something warm, running in my eyes
but somehow I found my baby that night
I raised her head then she smiled and said
hold me darling for a little while
I held her close, I kissed her our last kiss;
I found a love, that I knew I would miss
And now she's gone, even though I hold her tight;
I lost my love, my life, that night
Well, where oh where can my baby be?
The lord took her away from me
she's gone to heaven so I got to be good;
so I can see my baby when I leave this world
Hmmmmmmmmm
Hmmmmmmmmm
